            $platformVersion, $device, $mobile, $tablet, $bot, $desktop,
            $transcoder, $frames, $iframes, $tables, $cookies, $bgsound,
            $javascript, $vbscript, $java, $activex, $synreader, $pdf, $rss
        );
    }

